import React, { Component } from 'react';
//import styles from "./login.css";
import styles from "./GetMusic.css";

class Getmusic extends Component {
    state = { data: [] }
    async fetchAPI() {
        const a = window.location.href.split('/');
  const id = a[a.length - 1]
  console.log(id);
        const baseURL1 = 'http://localhost:8000/api/bookmarks/'+id;
        const response = await fetch(baseURL1);
        const data = await response.json();
        console.log(data);
        this.setState({
            data: data
        })
      }
      componentDidMount()
      {
        this.fetchAPI();
      }
    render() { 
        return ( 
            <div>
                <p>Get music</p>
                <div style={{webkit:'scrollbar' , width:'10px', scrolling:'true', background:'#f1f1f1'}}>
                {
                this.state.data.map((item)=>{
                    return (<ul>
                            <li>{item.url}</li>
                            <li>{item.artist}</li>
                            <li>{item.title}</li>
                    </ul>)
                })
                 }
                </div>
            </div>
         );
    }
}

export default Getmusic;
